import React from "react";

function ProgressBar({ correctAnswers, learnedWords }) {
  return (
    <div className="progress-bar">
      <div>Правильных ответов: {correctAnswers}</div>
      <div>Изученных слов: {learnedWords}</div>
    </div>
  );
}

export default ProgressBar;
